    false,nt"url": null,nt"notes": "The purpose of this Water Resource Inventory
    and Assessment Report for Modoc National Wildlife Refuge is to describe current
    hydrologic information, provide an assessment of water resource needs and issues
    of concerns, and make prioritized recommendations for research, coordination, and
    monitoring which can improve refuge management and decision making. Characterization
    of refuge water resources included the following major subject areas: water rights,
    hydroclimate, water supply and discharge (surface water and groundwater), soils,
    habitat management, water management and infrastructure, and water quality. Available
    information for these subject areas included research of studies and reports of
    relevant water resources investigations (both publicly available and scanned from
    refuge files), and summary and analysis of publicly available digital water monitoring
    and geospatially modeled data from local, state, and national agencies.",nt"license_title":
